import AddTimer from "./components/AddTimer";
import Header from "./components/Header";
import TimersContextProvider from "./store/timers-context";

function App() {
  return (
    <TimersContextProvider>
      <main>
        <Header />
        <AddTimer />
      </main>
    </TimersContextProvider>
  );
}

export default App;
